function Main() {
    return (
      <main>
        {/* 画像セクション */}
        <section style={{ width: '100%' }}>
          <img
            src="/images/together.png"
            alt="背景画像"
            style={{
              width: '100%',
              height: 'auto',
              display: 'block',
            }}
          />
        </section>

        {/* 続きのセクション */}
        <section style={{
          padding: '4rem 2rem',
          backgroundColor: '#5C849E',
          color: '#fff',
        }}>
          <h2>次のセクションへようこそ</h2>
          <p>
            この部分にサイトの紹介や詳細を入れましょう。
          </p>
        </section>
      </main>
    );
  }

  export default Main;
